      <h1 style={{ textAlign: "left" }}>using state</h1>
      <UsingState />
      <hr />
      <h1 style={{ textAlign: "left" }}>using effect</h1>

      <Usingeffect />
      <hr />
      <h1 style={{ textAlign: "left" ,color}}>using ref</h1>

      <UsingRef />
    </div>
  );
}

export default App;
